    XW += x[46]*54.092420; /*C4H612 */
    XW += x[47]*56.108360; /*C4H81 */
    XW += x[48]*55.100390; /*C4H7 */
    XW += x[49]*74.082840; /*C6H2 */
    XW += x[50]*75.090810; /*C6H3 */
    XW += x[51]*76.098780; /*l-C6H4 */
    XW += x[52]*76.098780; /*c-C6H4 */
    XW += x[53]*78.114720; /*A1 */
